package main

import "fmt"

/**
dp[i] = 0/1, 表示第i位能够到达
dp[i] = 1 if dp[l] ~ dp[r] 存在 dp==1, l = i-maxJump, r = i - minJump
前缀和pre[i] 表示j = 0~i-1中dp[j]==1
 */
func canReach(s string, minJump int, maxJump int) bool {
	n := len(s)
	dp := make([]int, n)
	dp[0] = 1
	pre := make([]int, n+1)
	for i := 1; i <= minJump; i++ {
		pre[i] = pre[i-1] + dp[i-1]
	}

	var l, r int
	for i := minJump; i < n; i++ {
		l = max(0, i - maxJump)
		r = i - minJump
		if s[i]=='0' && (pre[r+1] - pre[l]) > 0 {
			dp[i] = 1
		}
		pre[i+1] = pre[i] + dp[i]
	}
	return dp[n-1] == 1
}

func max(a, b int) int {
	if a > b {
		return a
	}
	return b
}

